            <div className = "welcome" >
            <div className = "welcome-content">
                <h2>HỌC CODE <span>C</span></h2>
                <p>Chúng tôi rất mong được sự góp ý của các bạn về website để ngày càng phục vụ công việc học tập của các bạn tốt hơn. 
                </p>
            </div>
            </div>
        )
    }
}
